import React from 'react';
import Card from './Card';

const CardList = ({robots}) =>{
	const CardArray = robots.map((robot , i) => {
			return(
				<Card id = {robot.id} name = {robot.name} email = {robot.email} />
			);
		}
		);
	return(
		<>	
			<CardArray/>
    	</>
	);
}

export default CardList;
